text:
Λέει σήμερα ο Καβατζίκης ότι ο #Φιλιππιδης ή θα ενοχοποιηθεί ή θα αθωωθεί από τη Δικαιοσύνη &amp; αυτό είναι ανεξάρτητο από το ΣΕΗ. 
Καταρχάς μάλλον ήθελε να πει "καταδικαστεί".Κατά δεύτερον μιλάει για αθώωση πριν καν ο άλλος απολογηθεί. 
Τι περιμένεις με καρδούλες στον #Σπυροπουλος;

#Σπυροπουλος όλα καλά;
Ετοιμάζεις παράσταση;

#MeToo 
#metooGR https://t.co/XfZU1mxrCv

Ετοιμάζεσαι "Σμαραγδούλα" για το τηλεσκουπίδι της Παρασκευής;

Επαναναρτάται.
#Φιλιππιδης #Λιγναδης #Σπυροπουλος #Χαϊκαλης #Χατζης #μμε_ξεφτιλες #metooGR #BoycottGreekMedia #καρυδηεκτοςμεγκα

Πολίτη, Βίσση, Γκαγκάκη, Αλεξανιάν, Παλαιολόγου&amp;λοιπές πλυντηριακές δυνάμεις
έχετε κάτι να σχολιάσετε για το περιστατικό στη #Νεα_Σμυρνη;
Καρδούλες μήπως για το δράστη;

Να μοιραστείτε ίσως μια δική σας ιστορία σεξ.παρενόχλησης;
Γιατί ΟΛΕΣ έχετε (τουλάχιστον) μία. 
#Σπυροπουλος

Τα χέρια που βοηθάνε είναι ιερότερα από τα χέρια που προσεύχονται λέει η παροιμία. 

Τα χέρια που ξεπλένουν άλλα χέρια που κλείδωναν πόρτες, μεταξύ άλλων, τι είναι;

#Σπυροπουλος #metooGR

"...η απελπισία και ο φόβος καταρρακώνουν[...] Εκεί ξεκινά ο Πολιτισμός:στην προσπάθεια του ανθρώπου να σώσει τον άνθρωπο. Nα του δώσει πίσω τη ζωή του."

Αλήθεια, ρε #Σπυροπουλος;

Γι'αυτό δεν μπόρεσες να ζητήσεις μια συγγνώμη από τα θύματα &amp; βάραγες εξώδικα λες κι ήταν μυγες;

Ρε παιδια, υπάρχει κάποια  καταγγελία για τον Μαρκουλάκη μέχρι στιγμής;;
Με έχει φάει η περιέργεια για το τι μπορεί να έχει κάνει, αν και κάτι έχω κατά νου...

#MeToo #metooGR #μαρκουλακης #λιγναδης #Μπαμπινιωτης #σπυροπουλος #Φιλιππιδης #κακαβας

Ποιός να είναι ο 65χρονος άραγε; Τί άλλο μας περιμένει;

Επαναναρτάται.
